import './App.css';
import ReactPlayer from 'react-player';

function App() {
  const videos = [
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=DLX62G4lc44',
    'https://www.youtube.com/watch?v=DLX62G4lc44',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=CVpUuw9XSjY'
  ];

  const listItems = videos.map((video, index) =>
    <div key={index}>
      <VideoDisplay url={video}/>
    </div>
  );

  let arrayDom = [];

  for (let i = 0; i < array.length; i++) {
    arrayDom.push(<div key={i}>
      <VideoDisplay url={'https://www.youtube.com/watch?v=35lXWvCuM8o'}/>
    </div>)
  }

  return (
    <div className="grid-container">{listItems}</div>
  );
}

const VideoDisplay = ({url}) => (<>
  <ReactPlayer
    url={url}
    className='react-player'
    playing
    width='100%'
    height='100%'
  />
</>)

